"use strict";

// A generic contructor which accepts an arbitrary descriptor object
function LevelOne(descr) {
   // Common inherited setup logic from Entity
   this.setup(descr);

   this.rememberResets();

   // Default sprite, if not otherwise specified
   this.sprite = this.sprite || g_sprites.mapOne;
};

LevelOne.prototype = new Entity();

LevelOne.prototype.rememberResets = function () {
   // Remember my reset positions
   this.reset_x = this.x;
   this.reset_y = this.y;
};

LevelOne.prototype.x = 0;
LevelOne.prototype.y = 0;

LevelOne.prototype._tileWidth = 24;
LevelOne.prototype._tileHeight = 24;
LevelOne.prototype._mapWidth = 3000;
LevelOne.prototype._mapHeight = 600;

LevelOne.prototype.KEY_RESTART = 'N'.charCodeAt(0);

LevelOne.prototype.colTileLoc = [];

LevelOne.prototype._isSetUp = false;

LevelOne.prototype.update = function (du) {
   spatialManager.unregister(this);

   if (!this._isSetup) {
      this.setupLevel(du);
   }

   if (this._isDeadNow) {
      return entityManager.KILL_ME_NOW;
   }

   spatialManager.register(this);
};

LevelOne.prototype.killMeNow = function () {
   this._isDeadNow = true;
};

LevelOne.prototype.setupLevel = function (du) {
   this.sprite.drawAt(g_ctxL, 0, 0);
   this.readMapJSON();
   this._isSetup = true;
};

